import React, { useState } from "react";
import { Link } from "react-router-dom";
const Home = () => {

    const [getuserdata,setUserdata] =useState([]);
    
    const getdata =async(e)=>{
      const res =await fetch("/getdata",{
        method:"GET",
        headers:{
          "Content-Type":"application/json"
        }
      });
        const data =await res.json();
        if(res.status ===404 || !data){
          console.log("error");
        }
        else{
          set
        }

    }




  return (
    <div>
      <div className="mt-5">
        <div className="container">
          <div className="add_btn mt-2">
            <Link to='/register'>
            <button className="btn btn-primary mb-3">Add data</button>
            </Link>
            
          </div>
          <table class="table">
            <thead>
              <tr className="table-dark">
                <th scope="col">Id</th>
                <th scope="col">Username</th>
                <th scope="col">Email</th>
                <th scope="col">job</th>
                <th scope="col">Number</th>
                <th scope="col"></th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <th scope="row">1</th>
                <td>Meet</td>
                <td>Meet@gmail.com</td>
                <td>Web Developer</td>
                <td>9987654390</td>
                <td className="d-flex justify-content-between">
                    <button className="btn btn-success"><i className="fa-solid fa-eye"></i></button>
                    <button className="btn btn-primary"><i className="fa-solid fa-pen-to-square"></i></button>
                    <button className="btn btn-danger"><i className="fa-solid fa-trash"></i></button>
                </td>
              </tr>
              <tr>
                <th scope="row">1</th>
                <td>Meet</td>
                <td>Meet@gmail.com</td>
                <td>Web Developer</td>
                <td>9987654390</td>
                <td className="d-flex justify-content-between">
                    <button className="btn btn-success"><i className="fa-solid fa-eye"></i></button>
                    <button className="btn btn-primary"><i className="fa-solid fa-pen-to-square"></i></button>
                    <button className="btn btn-danger"><i className="fa-solid fa-trash"></i></button>
                </td>
              </tr>
             
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Home;
